import { StyleSheet } from 'aphrodite/no-important'

export default StyleSheet.create({
  fontStyle: {
    color: 'rgba(0,0,0,.2)',
    fontSize: 60,
    textTransform: 'uppercase',
    letterSpacing: '1.65rem',
    fontFamily: 'Montserrat, sans-serif',
    margin: '10px 0'
  }
})
